import { ReactComponent as Title } from "../../src/assets/Title.svg";

export default function Header() {
  return (
    <div className="bg-white">
      <div className="max-w-full mx-auto px-3 border-b-1">
        <div className="flex items-center gap-5 justify-between py-3 border-b-[1px]">
          <div>
            <Title className="w-[236px] h-[56px]" />
          </div>
          <div className="flex items-center gap-5">

          </div>
        </div>
      </div>
    </div>
  );
}
